import React from 'react'

const ToDoList = ({msg}) => {
  const messages = JSON.parse(localStorage.getItem('messages'));

  return (
    <>
      {messages.map((item) => {
        return <div className='todo-item' key={item.id}></div>
      })}
    </>
  )
}

export default ToDoList
